message:
🤡-Diretoria da EBC é destituída por Lula após chamarem de manifestantes ao invés de  "vândalos"

Nos próximos 30 dias, a EBC iniciará um processo de reorganização para a retirada de todos que foram indicados durante o governo Bolsonaro, segundo informação do site BandaB. Kariane “conduzirá o processo de transição para nova gestão, a ser implementada nos próximos meses”, segundo nota divulgada pelo Planalto.

@gritodaliberdade - Telegram ✅
